import React from 'react';
import {
    Box,
    Icon,
    IconButton,
    styled,
    Table,
    Fab,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
  } from "@mui/material";
  import { useState,useEffect } from 'react';
  import { getUsers } from 'app/apis/apiMethods';

  const StyledTable = styled(Table)(({ theme }) => ({
    whiteSpace: "pre",
    "& thead": {
      "& tr": { "& th": { paddingLeft: 0, paddingRight: 0 } },
    },
    "& tbody": {
      "& tr": { "& td": { paddingLeft: 0, textTransform: "capitalize" } },
    },
  }));

const ViewProfile=()=>{
    const [state, setState] = useState([])


    const Data = async ()=>{

        const users = await getUsers()
       setState(users.data.data)
    }
    useEffect(()=>{
        Data();
    })

    return(
        <Container>
      <SimpleCard>
        <Box width="100%" overflow="auto">
          <StyledTable>
            <TableHead>
              <TableRow>
                <TableCell align="left">Id</TableCell>
                <TableCell align="left">Name</TableCell>
                <TableCell align="center">Email</TableCell>
                <TableCell align="center">User Name</TableCell>
                <TableCell align="center">Contact Number</TableCell>
                <TableCell align="center">Action</TableCell>
              </TableRow>
            </TableHead>

            <TableBody>
              {state.map((userList, index) => (
                <TableRow key={index}>
                  <TableCell align="left">{index + 1}</TableCell>
                  <TableCell align="left">{userList.full_name}</TableCell>
                  <TableCell align="center">{userList.email}</TableCell>
                  <TableCell align="center">{userList.user_name}</TableCell>
                  <TableCell align="center">
                    {userList.contact_number}
                  </TableCell>
                  <TableCell align="center">
                    <Fab color="secondary" aria-label="Edit" className="button">
                      <Link to={`/editUsers/${userList._id}`}>
                        <Icon>edit_icon</Icon>
                      </Link>
                    </Fab>
                    <Fab
                      aria-label="Delete"
                      className="button"
                      onClick={() => handleDelete(userList._id)}
                    >
                      <Icon>delete</Icon>
                    </Fab>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </StyledTable>
        </Box>
      </SimpleCard>
    </Container>

    )
}
export default ViewProfile;
